import React, { Component } from 'react'
import {Container, Navbar} from 'reactstrap';

export default class Navi extends Component {
  render() {
    return (
      <Container>
        <Navbar>
            <h1>Product Tracking System</h1>
        </Navbar>
        </Container>
    )
  }
}
